import history from "../../data/history/user_history";
import * as style from "../../css/light/focusedList"

export default function History(props) {
  const renderItems = () => {
    return history[props.profile].map((item, i) => (
      <div style={{marginLeft: "5px"}}>{item}</div>
    ))
  }

  return (
    <div style={{position: "absolute", top: "500px"}}>
      <div style={style.focusTitle}>User Profile History</div>
      <div style={{margin: "3px 0px 6px 8px", height: "1px", width: "32.1vw", backgroundColor: "#4382BC"}}></div>
      <div style={{backgroundColor: "white", marginLeft: "8px", marginTop: "3px", width: "32vw", height: "218px", border: "1px solid black"}}>{renderItems()}</div>
    </div>
  )
}
